	public int lengthOfLongestSubstring(String s){
		Map<Character, Integer> map = new HashMap<Character, Integer>();
		int maxSubstrLongest = 0;
		int currentlen = 0;
		char chs[] = s.toCharArray();
		for(int i=0; i<chs.length; i++){
			//从左到右依次遍历一遍
			if(!map.containsKey(chs[i])){
				currentlen++;
				map.put(chs[i], i+1);
			}else{
				int index = map.get(chs[i]);
				for(int j=0; j<index; j++){
					map.remove(chs[j]);
				}
				map.put(chs[i], i+1);
				if(currentlen>maxSubstrLongest){
					maxSubstrLongest = currentlen;
				}
				currentlen=currentlen-index+1;
			}
		}
		maxSubstrLongest = (currentlen>maxSubstrLongest)?currentlen:maxSubstrLongest;
		
		return maxSubstrLongest;
	}
	
